import add, { sub, mult, div } from "./Calc";

function App() {
  return (
    <>
      <ul>
        <li>The Addition of two numbers are {add(2, 2)}</li>
        <li>The Subtarction of two numbers are {sub(10, 5)}</li>
        <li>The multiplication of two numbers are {mult(2, 5)}</li>
        <li>The Division of two numbers are {div(10, 3)}</li>
      </ul>
    </>
  );
}

export default App;
